import React from "react";

function InputName() {
  return (
    <table className="container table table-danger">
      <thead>
        <tr>
          <th>first</th>
          <th>last</th>
          <th>age</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>Sherry</td>
          <td>Yang</td>
          <td>33</td>
        </tr>
      </tbody>
    </table>
  );
}

export default InputName;
